(8, 'en', 'humann raesbgcbg', '<p>علن البنك المركزي السعودي إصدار الصيغة النموذجية لوثيقة التأمين ضد المسؤولية المهنية لمراجعي حسابات المنشآت الخاضعة لإشراف هيئة السوق المالية، والتي تم العمل عليها بالتنسيق مع هيئة السوق المالية.</p>\r\n\r\n<p>وتأتي هذه الخطوة بهدف توحيد الحد الأدنى الواجب توفره في وثيقة التأمين، وتعزيز مفهوم الاستدامة، والحد من المخاطر المحتملة في السوق المالية، إلى جانب حماية حقوق كامل أطراف العلاقة التأمينية، وذلك ضمن جهود البنك المركزي السعودي الرامية لضمان حقوق أطراف العلاقة التأمينية، ودعم نمو وتطوير قطاع التأمين. وللاطلاع على الصيغة النموذجية</p>'),
(8, 'ar', 'العلامات التقنية', '<p>علن البنك المركزي السعودي إصدار الصيغة النموذجية لوثيقة التأمين ضد المسؤولية المهنية لمراجعي حسابات المنشآت الخاضعة لإشراف هيئة السوق المالية، والتي تم العمل عليها بالتنسيق مع هيئة السوق المالية.</p>\r\n\r\n<p>وتأتي هذه الخطوة بهدف توحيد الحد الأدنى الواجب توفره في وثيقة التأمين، وتعزيز مفهوم الاستدامة، والحد من المخاطر المحتملة في السوق المالية، إلى جانب حماية حقوق كامل أطراف العلاقة التأمينية، وذلك ضمن جهود البنك المركزي السعودي الرامية لضمان حقوق أطراف العلاقة التأمينية، ودعم نمو وتطوير قطاع التأمين. وللاطلاع على الصيغة النموذجية<img alt=\"رابط جريدة الرياض\" src=\"https://www.alriyadh.com/1962122\"></p>'),
(9, 'en', 'our clients', '<section dir=\"ltr\">\r\n<h5>Browse through millions of job postings; create a solid job portfolio to improve your chances of securing a huge gig. Perform research on a project or a company and decide which would best work for your case.Browse through millions of job postings; create a solid job portfolio to improve your chances of securing a huge gig. Perform research on a project or a company and decide which would best work for your case.Browse through millions of job postings; create a solid job portfolio to improve your chances of securing a huge gig. Perform research on a project or a company and decide which would best work for your case</h5>\r\n\r\n<p><img alt=\"\" src=\"https://www11.0zz0.com/2022/07/25/10/988089259.jpg\" xss=removed></p>\r\n</section>'),
(9, 'ar', 'الاستقطاب', '<p>Browse through millions of job postings; create a solid job portfolio to improve your chances of securing a huge gig. Perform research on a project or a company and decide which would best work for your case.Browse through millions of job postings; create a solid job portfolio to improve your chances of securing a huge gig. Perform research on a project or a company and decide which would best work for your case.Browse through millions of job postings; create a solid job portfolio to improve your chances of securing a huge gig. Perform research on a project or a company and decide which would best work for your case</p>\r\n\r\n<p>.<img alt=\"\" src=\"https://www12.0zz0.com/2022/07/25/10/168111904.jpg\" xss=\"removed\"></p>');
