('1658728135_1', 1, NULL, '<p> </p>\r\n\r\n<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n', 1, 'en'),
('1658728135_1', 1, NULL, '<p>لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لعمل كتاب عينة. لقد نجت ليس فقط خمسة قرون ، ولكن أيضًا القفزة في التنضيد الإلكتروني ، وظلت دون تغيير جوهري. تم نشره في الستينيات من القرن الماضي بإصدار أوراق Letraset التي تحتوي على مقاطع Lorem Ipsum ، ومؤخرًا مع برامج النشر المكتبي مثل Aldus PageMaker بما في ذلك إصدارات Lorem Ipsum.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n', 1, 'ar'),
('1658728135_2', 1, 'container', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n', 1, 'en'),
('1658728135_2', 1, 'container', '<p>لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لعمل كتاب عينة. لقد نجت ليس فقط خمسة قرون ، ولكن أيضًا القفزة في التنضيد الإلكتروني ، وظلت دون تغيير جوهري. تم نشره في الستينيات من القرن الماضي بإصدار أوراق Letraset التي تحتوي على مقاطع Lorem Ipsum ، ومؤخرًا مع برامج النشر المكتبي مثل Aldus PageMaker بما في ذلك إصدارات Lorem Ipsum.</p>\r\n', 1, 'ar'),
('1663827357_1', 1, 'section-headline centered mb-4', '<h2>How it works</h2>\r\n\r\n<p>Work with the genius minds, create trusted bonds and hire the best candidates for fast and efficient delivery of projects. Make the most use of our versatile and secure platform.</p>\r\n', 1, 'en'),
('1663827357_1', 1, 'section-headline centered mb-4', '<p>اعمل مع العقول العبقرية ، وأنشئ روابط موثوقة وقم بتوظيف أفضل المرشحين للتسليم السريع والفعال للمشاريع. حقق أقصى استفادة من نظامنا الأساسي متعدد الاستخدامات والآمن.</p>\r\n', 1, 'ar'),
('1663827357_1', 2, 'row', '<div class=\"col-md-4 col-12\">\r\n<div class=\"how-box\">\r\n<div class=\"how-steps\">\r\n<h2>01</h2>\r\n</div>\r\n<div class=\"how-box-icon\"><img alt=\"\" src=\"./assets/default/images/icon_job.png\"></div>\r\n<h3>Post A Job</h3>\r\n<p>Create a job post and start receiving bids almost instantly. Browse through the pool of freelancer ideal for your role.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-12\">\r\n<div class=\"how-box\">\r\n<div class=\"how-steps\">\r\n<h2>02</h2>\r\n</div>\r\n<div class=\"how-box-icon\"><img alt=\"\" src=\"./assets/default/images/icon_bid.png\"></div>\r\n<h3>Evaluate The Bids</h3>\r\n<p>Compare the various quotations and settle on one who is the best for your job profile. Get info and milestones touched for credibility.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-12\">\r\n<div class=\"how-box\">\r\n<div class=\"how-steps\">\r\n<h2>03</h2>\r\n</div>\r\n<div class=\"how-box-icon\"><img alt=\"\" src=\"./assets/default/images/icon_pay.png\"></div>\r\n<h3>Choose the right talent</h3>\r\n<p>Hire the most efficient candidate; get the job done on project or hourly basis. Once it’s over, make secure & hassle-free payments.</p>\r\n</div>\r\n</div>\r\n', 2, 'en'),
('1663827357_1', 2, 'row', '<div class=\"col-md-4 col-12\">\r\n<div class=\"how-box\">\r\n<div class=\"how-steps\">\r\n<h2>01</h2>\r\n</div>\r\n\r\n<h3>انشر الوظيفة</h3>\r\n\r\n<p>قم بإنشاء منشور وظيفة وابدأ في تلقي العطاءات على الفور تقريبًا تصفح مجموعة المستقلين المثالية لدورك.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-12\">\r\n<div class=\"how-box\">\r\n<div class=\"how-steps\">\r\n<h2>02</h2>\r\n</div>\r\n\r\n<h3>تقييم العطاءات</h3>\r\n\r\n<p>قارن بين عروض الأسعار المختلفة واستقر على من هو الأفضل لملفك الوظيفي. احصل على المعلومات والمعالم التي تم لمسها من أجل المصداقية.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4 col-12\">\r\n<div class=\"how-box\">\r\n<div class=\"how-steps\">\r\n<h2>03</h2>\r\n</div>\r\n\r\n<h3>اختر الموهبة المناسبة</h3>\r\n\r\n<p>توظيف المرشح الأكثر كفاءة ؛ إنجاز المهمة على أساس المشروع أو كل ساعة. بمجرد أن تنتهي ، قم بإجراء دفعات آمنة وخالية من المتاعب.</p>\r\n\r\n<div class=\"how-steps\">\r\n<h2>04</h2>\r\n</div>\r\n\r\n<h3>اختر الموهبة المناسبة</h3>\r\n\r\n<p>توظيف المرشح الأكثر كفاءة ؛ إنجاز المهمة على أساس المشروع أو كل ساعة. بمجرد أن تنتهي ، قم بإجراء دفعات آمنة وخالية من المتاعب.</p>\r\n</div>\r\n</div>\r\n', 2, 'ar'),
