('1686895001_1', 2, 'col-md-6 col-12 order-md-1', '<div class=\"paragraph\">\r\n<h2 class=\"title\">Find quality freelancers</h2>\r\n\r\n<h5>On Upwork you&#39;ll find a range of top talent, from programmers to designers, writers, customer support reps, and more.</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li>Tell us about your project and the specific skills required. Upwork analyses your needs. Our search functionality uses data science to highlight freelancers based on their skills, helping you find talent that&#39;s a good match.</li>\r\n <li>We send you a shortlist of likely candidates. You can also search our site for talent, and freelancers can view your job and submit proposals too.</li>\r\n <li>We have several measures in place to ensure Upwork is a fair and reliable marketplace.</li>\r\n</ul>\r\n</div>\r\n', 2, 'en'),
('1686895001_1', 2, 'col-md-6 col-12 order-md-1', '<div class=\"paragraph\">\r\n<h2 class=\"title\">ابحث عن موظفين مستقلين ذوي جودة</h2>\r\n\r\n<h5>ستجد في Upwork مجموعة من أفضل المواهب ، من المبرمجين إلى المصممين والكتاب ومندوبي دعم العملاء والمزيد.</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li>أخبرنا عن مشروعك والمهارات المحددة المطلوبة. Upwork يحلل احتياجاتك. تستخدم وظيفة البحث لدينا علم البيانات لتسليط الضوء على المستقلين بناءً على مهاراتهم ، مما يساعدك في العثور على المواهب المناسبة.</li>\r\n <li>نرسل لك قائمة مختصرة بالمرشحين المحتملين. يمكنك أيضًا البحث في موقعنا عن المواهب ، ويمكن للعاملين لحسابهم الخاص عرض وظيفتك وتقديم مقترحات أيضًا.</li>\r\n <li>لدينا العديد من الإجراءات لضمان أن Upwork هو سوق عادل وموثوق.</li>\r\n</ul>\r\n</div>\r\n', 2, 'ar'),
('1686895001_2', 1, 'col-md-6 col-12', '<p><img alt=\"\" class=\"img-fluid\" src=\"./assets/default/images/works-2.png\"></p>\r\n', 1, 'en'),
('1686895001_2', 1, 'col-md-6 col-12', '<p><img alt=\"\" class=\"img-fluid\" src=\"../assets/default/images/works-2.png\"></p>\r\n', 1, 'ar'),
('1686895001_2', 2, 'col-md-6 col-12', '<div class=\"paragraph\">\r\n<h2 class=\"title\">Hire the best freelancer</h2>\r\n\r\n<h5><b>Invite favorite candidates to submit bids, then review and hire your favorite. </b></h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>Browse profiles:</b> View finalists&#39; Upwork profiles to see client ratings, portfolios, Job Success scores, and more.</li>\r\n <li><b>Review proposals:</b> Evaluate bids, taking into account each freelancer&#39;s qualifications, thought process, timeline, and overall cost.</li>\r\n <li>Schedule a chat. Ask specific questions, determine who the best fit is, and contract.</li>\r\n</ul>\r\n</div>\r\n', 2, 'en'),
('1686895001_2', 2, 'col-md-6 col-12', '<div class=\"paragraph\">\r\n<h2 class=\"title\">وظف أفضل مترجم مستقل</h2>\r\n\r\n<h5><b>قم بدعوة المرشحين المفضلين لتقديم العطاءات ، ثم قم بمراجعتها وتوظيفها. </b></h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>تصفح الملفات الشخصية:</b>اعرض ملفات تعريف Upwork الخاصة بالمتسابقين النهائيين للاطلاع على تقييمات العملاء ، والمحافظ ، ودرجات النجاح في الوظيفة ، والمزيد.</li>\r\n <li><b>مراجعة المقترحات:</b>تقييم العطاءات ، مع الأخذ في الاعتبار مؤهلات كل عامل مستقل ، وعملية التفكير ، والجدول الزمني ، والتكلفة الإجمالية.</li>\r\n <li>جدولة الدردشة. اطرح أسئلة محددة ، وحدد من هو الأنسب ، وعقد.</li>\r\n</ul>\r\n</div>\r\n', 2, 'ar'),
('1686895001_3', 1, 'col-md-6 col-12 order-md-2', '<p><img alt=\"\" class=\"img-fluid\" src=\"./assets/default/images/works-3.png\"></p>\r\n', 1, 'en'),
('1686895001_3', 1, 'col-md-6 col-12 order-md-2', '<p><img alt=\"\" class=\"img-fluid\" src=\"../assets/default/images/works-3.png\"></p>\r\n', 1, 'ar'),
('1686895001_3', 2, 'col-md-6 col-12 order-md-1', '<div class=\"paragraph\">\r\n<h2 class=\"title\">Work efficiently, effectively.</h2>\r\n\r\n<h5><b>Each project includes an online workspace shared by your team and your freelancer, allowing you to: </b></h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li>Send and receive files. Deliver digital assets in a secure environment.</li>\r\n <li>Share feedback in real time. Use Upwork Messages to communicate via text or chat.</li>\r\n</ul>\r\n\r\n<h5><a aria-controls=\"collapseExample\" aria-expanded=\"false\" class=\"d-flex\" data-toggle=\"collapse\" href=\"#collapseExample\" role=\"button\">How do I know my freelancer is accurately billing for my project? </a></h5>\r\n\r\n<div class=\"collapse\" id=\"collapseExample\">\r\n<p>Built into Upwork are several methods of verifying work. On hourly contracts, you can review the Work Diary. It tracks billable time and records completed work. While the freelancer is billing you it also counts keystrokes and takes screenshots of the freelancer&#39;s screen (six times per hour), so you can verify billable hours. On fixed-price jobs, you and your freelancer agree on milestones for each project. When your freelancer reaches a milestone, you review the work and release funds when the work is approved.</p>\r\n</div>\r\n</div>\r\n', 2, 'en'),
('1686895001_3', 2, 'col-md-6 col-12 order-md-1', '<div class=\"paragraph\">\r\n<h2 class=\"title\">العمل بكفاءة وفعالية.</h2>\r\n\r\n<h5><b>يتضمن كل مشروع مساحة عمل عبر الإنترنت يشاركها فريقك وصاحب العمل المستقل ، مما يتيح لك:</b></h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li>إرسال واستقبال الملفات. تقديم الأصول الرقمية في بيئة آمنة.</li>\r\n <li>مشاركة الملاحظات في الوقت الحقيقي. استخدم Upwork Messages للتواصل عبر الرسائل النصية أو الدردشة.</li>\r\n</ul>\r\n\r\n<h5><a aria-controls=\"collapseExample\" aria-expanded=\"false\" class=\"d-flex\" data-toggle=\"collapse\" href=\"#collapseExample\" role=\"button\">كيف أعرف أن المستقل الذي أعمل به يقوم بالدفع بدقة لمشروعي؟ </a></h5>\r\n\r\n<div class=\"collapse\" id=\"collapseExample\">\r\n<p>المضمنة في Upwork هي عدة طرق للتحقق من العمل. في العقود بالساعة ، يمكنك مراجعة يوميات العمل. يتتبع الوقت القابل للفوترة ويسجل العمل المنجز. أثناء قيام العامل المستقل بإعداد الفواتير لك ، فإنه يحسب أيضًا ضغطات المفاتيح ويأخذ لقطات شاشة لشاشة المستقل (ست مرات في الساعة) ، حتى تتمكن من التحقق من الساعات المدفوعة. في الوظائف ذات السعر الثابت ، توافق أنت وصاحب العمل المستقل على معالم لكل مشروع. عندما يصل المستقل الخاص بك إلى مرحلة هامة ، تقوم بمراجعة العمل وتحرير الأموال عند الموافقة على العمل.</p>\r\n</div>\r\n</div>\r\n', 2, 'ar'),
('1686895001_4', 1, 'col-md-6 col-12', '<p><img alt=\"\" class=\"img-fluid\" src=\"./assets/default/images/works-4.png\"></p>\r\n', 1, 'en'),
('1686895001_4', 1, 'col-md-6 col-12', '<p><img alt=\"\" class=\"img-fluid\" src=\"../assets/default/images/works-4.png\"></p>\r\n', 1, 'ar'),
('1686895001_4', 2, 'col-md-6 col-12', '<div class=\"paragraph\">\r\n<h2 class=\"title\">Pay easily, with peace of mind</h2>\r\n\r\n<h5><b>Pay your freelancer by the hour, or a fixed price for the entire project. On fixed-price jobs, use our licensed escrow service to release funds as pre-set milestones are met. </b></h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>Simplified global payments:</b> We deliver payments to freelancers in over 170 countries.</li>\r\n <li><b>Includes Upwork Payment Protection:</b> Only pay for work you authorize.</li>\r\n <li><b>Invoicing and reporting:</b> Access your invoices and transaction history on Upwork.</li>\r\n</ul>\r\n</div>\r\n', 2, 'en'),
('1686895001_4', 2, 'col-md-6 col-12', '<div class=\"paragraph\">\r\n<h2 class=\"title\">ادفع بسهولة وراحة البال</h2>\r\n\r\n<h5><b>ادفع للمحترف المستقل بالساعة أو بسعر ثابت للمشروع بأكمله. في الوظائف ذات السعر الثابت ، استخدم خدمة الضمان المرخصة لدينا للإفراج عن الأموال عند استيفاء المعالم المحددة مسبقًا.</b></h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>المدفوعات العالمية المبسطة:</b> نحن نقدم مدفوعات إلى المستقلين في أكثر من 170 دولة.</li>\r\n <li><b>يشمل حماية الدفع:</b> ادفع فقط مقابل العمل الذي تأذن به.</li>\r\n <li><b>الفواتير والتقارير:</b> الوصول إلى فواتيرك وسجل المعاملات على Upwork.</li>\r\n</ul>\r\n</div>\r\n', 2, 'ar'),
('1686895374_1', 1, 'col-md-6 col-12 text-center', '<p><img alt=\"\" class=\"img-fluid\" src=\"./assets/default/images/works-1a.png\"></p>\r\n', 1, 'en'),
('1686895374_1', 1, 'col-md-6 col-12 text-center', '<p><img alt=\"\" class=\"img-fluid\" src=\"../assets/default/images/works-1a.png\"></p>\r\n', 1, 'ar'),
('1686895374_1', 2, 'col-md-6 col-12', '<div class=\"paragraph\">\r\n<h2 class=\"title\">Create An Account</h2>\r\n\r\n<h5>Upwork is a great place to find more clients, and to run and grow your own freelance business.</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>Freedom to work on ideal projects:</b> On Upwork, you run your own business and choose your own clients and projects. Just complete your profile and we&#39;ll highlight ideal jobs. Also search projects, and respond to client invitations.</li>\r\n <li><b>Wide variety and high pay:</b> Clients are now posting jobs in hundreds of skill categories, paying top price for great work.</li>\r\n <li><b>More and more success:</b> The greater the success you have on projects, the more likely you are to get hired by clients that use Upwork.</li>\r\n</ul>\r\n</div>\r\n', 2, 'en'),
('1686895374_1', 2, 'col-md-6 col-12', '<div class=\"paragraph\">\r\n<h2 class=\"title\">إنشاء حساب</h2>\r\n\r\n<h5>Upwork هو مكان رائع للعثور على المزيد من العملاء ولإدارة وتنمية أعمالك المستقلة.</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li>حرية العمل في مشاريع مثالية: في Upwork ، تدير عملك الخاص وتختار العملاء والمشاريع الخاصة بك. فقط أكمل ملفك الشخصي وسنبرز الوظائف المثالية. ابحث أيضًا عن المشاريع واستجب لدعوات العملاء.</li>\r\n <li>تنوع كبير وأجور عالية: ينشر العملاء الآن وظائف في مئات من فئات المهارات ، ويدفعون أعلى سعر مقابل العمل الرائع.</li>\r\n <li>المزيد والمزيد من النجاح: كلما زاد نجاحك في المشاريع ، زادت احتمالية توظيفك من قبل العملاء الذين يستخدمون Upwork.</li>\r\n</ul>\r\n</div>\r\n', 2, 'ar'),
('1686895374_2', 1, 'col-md-6 col-12 order-md-2', '<p><img alt=\"\" class=\"img-fluid\" src=\"./assets/default/images/works-2a.png\"></p>\r\n', 1, 'en'),
('1686895374_2', 1, 'col-md-6 col-12 order-md-2', '<p><img alt=\"\" class=\"img-fluid\" src=\"../assets/default/images/works-2a.png\"></p>\r\n', 1, 'ar'),
('1686895374_2', 2, 'col-md-6 col-12 order-md-1', '<div class=\"paragraph\">\r\n<h2 class=\"title\">Search Jobs</h2>\r\n\r\n<h5>Upwork makes it easy to connect with clients and begin doing great work.</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>Streamlined hiring:</b> Upwork&#39;s sophisticated algorithms highlight projects you&#39;re a great fit for.</li>\r\n <li><b>Top Rated and Rising Talent programs:</b> Enjoy higher visibility with the added status of prestigious programs.</li>\r\n <li><b>Do substantial work with top clients:</b> Upwork pricing encourages freelancers to use Upwork for repeat relationships with their clients.</li>\r\n</ul>\r\n</div>\r\n', 2, 'en'),
('1686895374_2', 2, 'col-md-6 col-12 order-md-1', '<div class=\"paragraph\">\r\n<h2 class=\"title\">بحث وظائف</h2>\r\n\r\n<h5>يجعل Upwork من السهل التواصل مع العملاء والبدء في القيام بعمل رائع.</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li>التوظيف المبسط: تسلط خوارزميات Upwork المتطورة الضوء على المشاريع التي تناسبك تمامًا. </li>\r\n <li>برامج المواهب الأعلى تقييمًا والصاعدة: تمتع برؤية أعلى مع الوضع الإضافي للبرامج المرموقة.</li>\r\n <li>قم بعمل كبير مع كبار العملاء: يشجع تسعير Upwork المستقلين على استخدام Upwork لتكرار العلاقات مع عملائهم.</li>\r\n</ul>\r\n</div>\r\n', 2, 'ar'),
('1686895374_3', 1, 'col-md-6 col-12', '<p><img alt=\"\" class=\"img-fluid\" src=\"./assets/default/images/works-3a.png\"></p>\r\n', 1, 'en'),
('1686895374_3', 1, 'col-md-6 col-12', '<p><img alt=\"\" class=\"img-fluid\" src=\"../assets/default/images/works-3a.png\"></p>\r\n', 1, 'ar'),
('1686895374_3', 2, 'col-md-6 col-12', '<div class=\"paragraph\">\r\n<h2 class=\"title\">Work efficiently, effectively.</h2>\r\n\r\n<h5>With Upwork, you have the freedom and flexibility to control when, where, and how you work. Each project includes an online workspace shared by you and your client, allowing you to:</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>Send and receive files:</b> Deliver digital assets in a secure environment.</li>\r\n <li><b>Share feedback in real time:</b> Use Upwork Messages to communicate via text or chat.</li>\r\n</ul>\r\n\r\n<h5>How does Upwork&#39;s platform help me manage my work?</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li>Upwork provides a user-friendly platform to help you chat and share files, track your time, and get paid.</li>\r\n</ul>\r\n</div>\r\n', 2, 'en'),
('1686895374_3', 2, 'col-md-6 col-12', '<h2 class=\"title\">العمل بكفاءة وفعالية.</h2>\r\n\r\n<h5>مع Upwork ، لديك الحرية والمرونة للتحكم في وقت ومكان وكيفية عملك. يتضمن كل مشروع مساحة عمل عبر الإنترنت تشاركها أنت وعميلك ، مما يتيح لك:</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>إرسال واستقبال الملفات:</b> تقديم الأصول الرقمية في بيئة آمنة.</li>\r\n <li><b>مشاركة التعليقات في الوقت الفعلي:</b> استخدم Upwork Messages للتواصل عبر الرسائل النصية أو الدردشة.</li>\r\n</ul>\r\n\r\n<h5>كيف تساعدني منصة Upwork في إدارة عملي؟</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li>يوفر Upwork نظامًا أساسيًا سهل الاستخدام لمساعدتك على الدردشة ومشاركة الملفات وتتبع وقتك وكسب المال.</li>\r\n</ul>\r\n', 2, 'ar'),
('1686895374_4', 1, 'col-md-6 col-12 order-md-2', '<p><img alt=\"\" class=\"img-fluid\" src=\"./assets/default/images/works-4a.png\"></p>\r\n', 1, 'en'),
