('1686895374_4', 2, 'col-md-6 col-12 order-md-1', '<div class=\"paragraph\">\r\n<h2 class=\"title\">Get paid on time</h2>\r\n\r\n<h5>All projects include Upwork Payment Protection — helping ensure that you get paid for all work successfully completed through the freelancing website.</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>All invoices and payments happen through Upwork:</b> Count on a simple and streamlined process.</li>\r\n <li><b>Hourly and fixed-price projects:</b> For hourly work, submit timesheets through Upwork. For fixed-price jobs, set milestones and funds are released via Upwork escrow features.</li>\r\n <li><b>Multiple payment options:</b> Choose a payment method that works best for you, from direct deposit or PayPal to wire transfer and more.</li>\r\n</ul>\r\n</div>\r\n', 2, 'en'),
('1686895374_4', 2, 'col-md-6 col-12 order-md-1', '<div class=\"paragraph\">\r\n<h2 class=\"title\">يتقاضون رواتبهم في الوقت المحدد</h2>\r\n\r\n<h5>تشتمل جميع المشاريع على Upwork Payment Protection - مما يساعد على ضمان حصولك على أموال مقابل جميع الأعمال المنجزة بنجاح من خلال موقع الويب المستقل.</h5>\r\n\r\n<ul class=\"list list-2\">\r\n <li><b>جميع الفواتير والمدفوعات تتم من خلال Upwork:</b> اعتمد على عملية بسيطة ومبسطة.</li>\r\n <li><b>المشاريع بالساعة والسعر الثابت:</b>للعمل كل ساعة ، أرسل الجداول الزمنية من خلال Upwork. بالنسبة للوظائف ذات السعر الثابت ، يتم تحرير المعالم الرئيسية والأموال عبر ميزات الضمان Upwork.</li>\r\n <li><b>خيارات دفع متعددة:</b> اختر طريقة الدفع التي تناسبك ، من الإيداع المباشر أو PayPal إلى التحويل البنكي والمزيد.</li>\r\n</ul>\r\n</div>\r\n', 2, 'ar'),
('1686910888_1', 1, 'col-sm-6', '<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-2\" role=\"introduction\">England&#39;s World Cup winner Ben Stokes will retire from one-day international cricket after Tuesday&#39;s series opener against South Africa in Durham.</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-3.0\">The 31-year-old, who made his debut against Ireland in 2011, has scored 2,919 runs, including three centuries, and taken 74 wickets in 104 ODIs.</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-4\">Stokes, who <a data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-4.$link-2\" href=\"https://www.bbc.co.uk/sport/cricket/61163496\" title=\"\">became Test captain</a> in April, will still play Twenty20 cricket as well as leading the red-ball side.</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-5\">\"Three formats are just unsustainable for me now,\" said the all-rounder.</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-6\">\"This has been an incredibly tough decision to make. I have loved every minute of playing with my mates for England. We have had an incredible journey on the way.\"</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-7\">At one-day level, Stokes will best be remembered for his player-of-the-match performance in <a data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-7.$link-2\" href=\"https://www.bbc.co.uk/sport/cricket/48983890\" title=\"\">England&#39;s 2019 World Cup final win</a> over New Zealand at Lord&#39;s, with the left-hander making 84 not out to force a super over, which Eoin Morgan&#39;s side won on boundary countback.</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-8\">He announced last week that he would <a data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-8.$link-2\" href=\"https://www.bbc.co.uk/sport/cricket/62181746\" title=\"\">miss this season&#39;s Hundred competition</a> to manage his workload, and was left out of England&#39;s T20 squad for the upcoming games against South Africa.</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-9\">Stokes added: \"As hard as a decision as this was to come to, it&#39;s not as hard dealing with the fact I can&#39;t give my team-mates 100% of myself in this format any more. The England shirt deserves nothing less from anyone who wears it.</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-10\">\"Not only do I feel that my body is letting me down because of the schedule and what is expected of us, but I also feel that I am taking the place of another player who can give Jos [Buttler, England&#39;s one-day captain] and the rest of the team their all. It&#39;s time for someone else to progress as a cricketer and make incredible memories like I have over the past 11 years.</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-11\">\"I have loved all 104 games I have played so far, I&#39;ve got one more, and it feels amazing to be playing my last game at my home ground in Durham.</p>\r\n\r\n<p data-reactid=\".242f7rynkoq.0.0.0.1.$paragraph-12\">\"As always, the England fans have always been there for me and will continue to be there. You&#39;re the best fans in the world.\"</p>\r\n', 1, 'en'),
('1686910888_1', 1, 'col-sm-6', '<p>يعتزل بن ستوكس الفائز بكأس العالم الإنجليزي من ممارسة لعبة الكريكيت الدولية ليوم واحد بعد المباراة الافتتاحية يوم الثلاثاء ضد جنوب أفريقيا في دورهام.</p>\r\n\r\n<p>سجل اللاعب البالغ من العمر 31 عامًا ، والذي ظهر لأول مرة ضد أيرلندا في عام 2011 ، 2919 نقطة ، بما في ذلك ثلاثة قرون ، وحصل على 74 ويكيت في 104 نقطة انطلاق.</p>\r\n\r\n<p>ستوكس ، الذي أصبح قائد الاختبار في أبريل ، سيظل يلعب لعبة Twenty20 للكريكيت بالإضافة إلى قيادة فريق الكرة الحمراء.</p>\r\n\r\n<p>\"ثلاثة تنسيقات غير مستدامة بالنسبة لي الآن ،\" قال الجميع.</p>\r\n\r\n<p>\"لقد كان هذا قرارًا صعبًا بشكل لا يصدق. لقد أحببت كل دقيقة من اللعب مع زملائي في إنجلترا. لقد كانت لدينا رحلة رائعة في الطريق.\"</p>\r\n\r\n<p>على مستوى اليوم الواحد ، سيبقى ذكرى ستوكس أفضل من حيث أدائه كأفضل لاعب في المباراة في فوز إنجلترا في نهائيات كأس العالم 2019 على نيوزيلندا على ملعب لوردز ، حيث لم يخرج صاحب اليد اليسرى بفارق 84 مرة ، وهو ما فاز فريق Eoin Morgan في عد الحدود.</p>\r\n\r\n<p>أعلن الأسبوع الماضي أنه سيغيب عن مسابقة Hundred لهذا الموسم لإدارة عبء العمل ، وتم استبعاده من تشكيلة T20 في إنجلترا للمباريات القادمة ضد جنوب إفريقيا.</p>\r\n\r\n<p>وأضاف ستوكس: \"على الرغم من صعوبة اتخاذ هذا القرار ، إلا أنه ليس من الصعب التعامل مع حقيقة أنني لا أستطيع إعطاء زملائي في الفريق 100٪ من نفسي بهذا الشكل بعد الآن. قميص إنجلترا لا يستحق أقل من ذلك. لمن يرتديه.</p>\r\n\r\n<p>\"لا أشعر فقط أن جسدي يخذلني بسبب الجدول الزمني وما هو متوقع منا ، ولكني أشعر أيضًا أنني آخذ مكان لاعب آخر يمكنه منح جوس [باتلر ، قائد إنجلترا ليوم واحد] وبقية أعضاء الفريق كلهم. لقد حان الوقت لشخص آخر ليتقدم كلاعب كريكيت ويصنع ذكريات رائعة مثل ذكرياتي على مدى السنوات الـ 11 الماضية.</p>\r\n\r\n<p>\"لقد أحببت جميع المباريات الـ 104 التي لعبتها حتى الآن ، ولدي واحدة أخرى ، ومن الرائع أن ألعب آخر مباراة لي على أرض منزلي في دورهام.</p>\r\n\r\n<p>\"كما هو الحال دائمًا ، كانت جماهير إنجلترا دائمًا موجودة من أجلي وستستمر في التواجد هناك. أنت أفضل المشجعين في العالم.\"</p>\r\n', 1, 'ar'),
