(1, 'en', 'About Us', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>', 'about us', 'about us', 'about us page'),
(1, 'ar', 'معلومات عنا', '<p>لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان Lorem Ipsum هو النص الوهمي القياسي في الصناعة منذ القرن الخامس عشر الميلادي ، عندما أخذت طابعة غير معروفة لوحًا من النوع وتدافعت عليه لعمل كتاب عينة. لقد نجت ليس فقط خمسة قرون ، ولكن أيضًا القفزة في التنضيد الإلكتروني ، وظلت دون تغيير جوهري. تم نشره في الستينيات من القرن الماضي بإصدار أوراق Letraset التي تحتوي على مقاطع Lorem Ipsum ، ومؤخرًا مع برامج النشر المكتبي مثل Aldus PageMaker بما في ذلك إصدارات Lorem Ipsum.</p>', 'معلومات عنا', 'معلومات عنا', 'صفحة عنا'),
(11, 'en', 'How It Works', '<p><span lang=\"EN-US\" xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">Work with the genius minds, create trusted bonds and hire the best candidates for fast and efficient delivery of projects. Make the most use of our versatile and secure platform.</span></span></span></p>', 'How It Works', 'How It Works', 'How It Works'),
(11, 'ar', 'كيف تعمل', '<p>اعمل مع العقول العبقرية ، وأنشئ روابط موثوقة وقم بتوظيف أفضل المرشحين للتسليم السريع والفعال للمشاريع. حقق أقصى استفادة من نظامنا الأساسي متعدد الاستخدامات والآمن.</p>', 'كيف تعمل', 'كيف تعمل', 'كيف تعمل'),
(13, 'en', 'Employer', '<p>Employer</p>\r\n\r\n<p>is the leading job site in the Middle East and North Africa, connecting job seekers with employers looking to hire. Every day, thousands of new job vacancies are listed on the award-winning platform from the region&#39;s top employers.</p>', 'Employer', 'Employer', 'Employer'),
(13, 'ar', 'صاحب العمل', '<p>صاحب العمل</p>\r\n\r\n<p> أكبر موقع للوظائف في منطقة الشرق الأوسط وشمال افريقيا، وهو صلة الوصل بين الباحثين عن عمل وأصحاب العمل الذين ينوون التوظيف. كل يوم، يقوم أهم أصحاب العمل في المنطقة بإضافة آلاف الوظائف الشاغرة على المنصة الحائزة على جوائز عدة.</p>', 'صاحب العمل', 'صاحب العمل', 'صاحب العمل'),
