(34, 'Dispute send to admin', 'dispute-send-to-admin', ' {RECEIVER_NAME}=>Employer Name\r\n{SENDER_NAME}=>Freelancer Name\r\n{TITLE} =>Project Name\r\n{CONTRACT_TITLE}=>Contract Name\r\n{MILESTONE_TITLE}=>Milestone Name\r\n{DISPUTE_URL}=>Dispute Details Link', 0, 1),
