INSERT INTO `pref_mailtemplate_names` (`template_id`, `template_subject`, `template_content`, `lang`) VALUES
(1, 'تحقق من حسابك الجديد!', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {MEMBER_NAME} ، مرحبًا بك في {WEBSITE_NAME}!<br>\r\nهل أنت مستعد للبدء؟</p>\r\n\r\n<p><br>\r\nانقر هنا لتفعيل حسابك</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {VERIFICATION_URL}</p>', 'ar'),
(1, 'Verify Your New Account!', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {MEMBER_NAME}, Welcome To {WEBSITE_NAME}!</h2>\r\n\r\n<p>Are you ready to get started?</p>\r\n\r\n<p><br>\r\n<a href=\"{VERIFICATION_URL}\">Click Here To Activate Your Account </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {VERIFICATION_URL}</p>', 'en'),
(2, 'مستخدم جديد مسجل للتو', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا المشرف ،</p>\r\n\r\n<p>مستخدم جديد مسجل للتو.</p>\r\n\r\n<p>انقر هنا لعرض جميع</p>', 'ar'),
(2, 'A new user just registered', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>Hi admin ,</p>\r\n\r\n<p>A new user just registed.</p>\r\n\r\n<p><a href=\"{MEMBER_URL}\">Click here</a> to view all</p>', 'en'),
(3, 'إعادة تعيين كلمة المرور', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>عزيزي {MEMBER_NAME}<br>\r\nهل أنت جاهز لتغيير كلمة المرور الخاصة بك.</p>\r\n\r\n<p><br>\r\nاضغط هنا لتغير كلمة السر الخاصة بك</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {VERIFY_URL}</p>', 'ar'),
(3, 'Password Reset', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Dear {MEMBER_NAME}</h2>\r\n\r\n<p>Are You Ready To Change Your Password.</p>\r\n\r\n<p><br>\r\n<a href=\"{VERIFY_URL}\">Click Here To Change Your Password </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {VERIFY_URL}</p>', 'en'),
(4, 'تم التحقق من بريدك الإلكتروني بنجاح!', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {MEMBER_NAME} ،<br>\r\nشكرا للتحقق من حساب البريد الإلكتروني الخاص بك.</p>', 'ar'),
(4, 'Your Email Verified Successfully!', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {MEMBER_NAME},</h2>\r\n\r\n<p>Thanks for verifying your email account.</p>', 'en'),
(5, 'طلب التحقق من وثيقة جديدة', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا المشرف ،</p>\r\n\r\n<p>مستخدم جديد ({MEMBER_NAME}) أرسل المستند للتحقق.</p>\r\n\r\n<p>انقر هنا لعرض جميع</p>', 'ar'),
(5, 'A new document verification request', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>Hi admin ,</p>\r\n\r\n<p>A new user ({MEMBER_NAME}) just submit document for verification.</p>\r\n\r\n<p><a href=\"{DOCUMENT_URL}\">Click here</a> to view all</p>', 'en'),
(6, 'مشروع جديد تم نشره', '<p>تم نشر مشروع جديد.</p>\r\n\r\n<p>العنوان: {TITLE}</p>\r\n\r\n<p>مطلوب الاثبات.</p>', 'ar'),
(6, 'New project Posted', '<p>New Project is posted .</p>\r\n\r\n<p>Title : <strong>{TITLE}</strong></p>\r\n\r\n<p>Approval Needed.</p>', 'en'),
(7, 'لديك اقتراح جديد.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {RECEIVER_NAME} ،<br>\r\nلديك اقتراح جديد للمشروع {TITLE}</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {PROJECT_URL}</p>', 'ar'),
(7, 'You have new proposal.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>You have a new proposal for the project <strong>{TITLE} </strong></p>\r\n\r\n<p><br>\r\n<a href=\"{PROJECT_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {PROJECT_URL}</p>', 'en'),
(8, 'نجاح التحقق من المستند الخاص بك', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {MEMBER_NAME} ،</p>\r\n\r\n<p>تم التحقق من ملفك الشخصي بنجاح. الآن يمكنك تقديم اقتراح إلى {WEBSITE_NAME}.</p>', 'ar'),
(8, 'Your document verification success', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>Hi {MEMBER_NAME} ,</p>\r\n\r\n<p>Your profile successfully verified . Now you can please proposal to the {WEBSITE_NAME}.</p>', 'en'),
(9, 'تم رفض التحقق من المستند الخاص بك', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {MEMBER_NAME} ،</p>\r\n\r\n<p>تم رفض طلب ملفك الشخصي للسبب التالي</p>\r\n\r\n<p>{السبب}.</p>\r\n\r\n<p>يرجى تصحيح هذه وإعادة الإرسال.</p>', 'ar'),
(9, 'Your document verification got rejected', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>Hi {MEMBER_NAME} ,</p>\r\n\r\n<p>Your profile application got rejected for the following reason</p>\r\n\r\n<p>{REASON}.</p>\r\n\r\n<p>Please correct those and submit again.</p>\r\n\r\n<p> </p>', 'en'),
(10, 'هل نسيت كلمة السر', '<p>عزيزي{USER}      </p>\r\n\r\n<p>انقر فوق الرابط أدناه لإعادة تعيين كلمة المرور الخاصة بك</p>\r\n\r\n<p>{RESET_LINK}</p>', 'ar'),
(10, 'Forgot password', '<p>Dear {USER},</p>\r\n\r\n<p>Click on the below link to reset your password</p>\r\n\r\n<p><a href=\"{RESET_LINK}\">{RESET_LINK}</a></p>', 'en'),
(11, 'تم حظر حسابك على {WEBSITE_NAME}.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>عزيزي {MEMBER_NAME}<br>\r\nتم حظر حسابك على {WEBSITE_NAME}.</p>\r\n\r\n<p>لمزيد من المعلومات ، يرجى الاتصال بدعم العملاء.</p>', 'ar'),
(11, 'You account on {WEBSITE_NAME} has been blocked.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Dear {MEMBER_NAME}</h2>\r\n\r\n<p>You account on {WEBSITE_NAME} has been blocked.</p>\r\n\r\n<hr>\r\n<p>For Further Any Information, Please Contact Our <a href=\"{CUSTOMER_SUPPORT_URL}\">Customer Support.</a></p>', 'en'),
(12, 'لديك عرض جديد.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {RECEIVER_NAME} ،<br>\r\nتهانينا ، لقد حصلت على خصم جديد في المشروع {TITLE} ،</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {OFFER_URL}</p>', 'ar'),
(12, 'You have new offer.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>congratulation, you got a new off for the project <strong>{TITLE} </strong>,</p>\r\n\r\n<p><br>\r\n<a href=\"{OFFER_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {OFFER_URL}</p>', 'en'),
(13, 'تم قبول عرضك', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {RECEIVER_NAME} ،<br>\r\nمبروك ، لقد تم قبول عرضك الخاص بالمشروع {TITLE}.</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {OFFER_URL}</p>', 'ar'),
(13, 'Your offer has been accepted', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>congratulation, your offer for the project <strong>{TITLE} </strong>has been accepted.</p>\r\n\r\n<p><br>\r\n<a href=\"{OFFER_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {OFFER_URL}</p>', 'en'),
(14, 'تم رفض عرضك', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {RECEIVER_NAME} ،<br>\r\nعذرًا ، تم رفض عرضك الخاص بالمشروع {TITLE}.</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {OFFER_URL}</p>', 'ar'),
(14, 'Your offer has been rejected', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>Sorry, your offer for the project <strong>{TITLE} </strong>has been rejected.</p>\r\n\r\n<p><br>\r\n<a href=\"{OFFER_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {OFFER_URL}</p>', 'en'),
(15, 'طلب تقديم العمل', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {RECEIVER_NAME} ،<br>\r\nلديك طلب مجموع عمل للمشروع {TITLE}.</p>\r\n\r\n<p>اسم العقد: {CONTRACT_TITLE}</p>\r\n\r\n<p>اسم الحدث الرئيسي: {MILESTONE_TITLE}</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {WORK_URL}</p>', 'ar'),
(15, 'Work submission request', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>You have a work sumission request for the project <strong>{TITLE} </strong>.</p>\r\n\r\n<p>Contract Name: <strong>{CONTRACT_TITLE}</strong></p>\r\n\r\n<p>Milestone Name: <strong>{MILESTONE_TITLE}</strong></p>\r\n\r\n<p><br>\r\n<a href=\"{WORK_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {WORK_URL}</p>', 'en'),
(16, 'طلب اتصال جديد', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>أهلا،</p>\r\n\r\n<p>لديك طلب اتصال جديد.</p>\r\n\r\n<p>البريد الإلكتروني: {EMAIL}</p>\r\n\r\n<p>استفسار عن: {ENQUIRY_FOR}</p>\r\n\r\n<p>الرسالة: {MESSAGE}</p>\r\n\r\n<p>شكرا</p>', 'ar'),
(16, 'New Contact Request', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>hi,</p>\r\n\r\n<p>You have a new contact Request. </p>\r\n\r\n<p><strong>Email :</strong> {EMAIL}</p>\r\n\r\n<p><strong>Enquiry For:</strong> {ENQUIRY_FOR}</p>\r\n\r\n<p><strong>Message:</strong> {MESSAGE}</p>\r\n\r\n<p>Thanks</p>', 'en'),
(17, 'إعادة: {WEBSITE_NAME} {SUBJECT}', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>أهلا ،</p>\r\n\r\n<p>{رسالة}</p>\r\n\r\n<p>شكرا</p>', 'ar'),
(17, 'RE: {WEBSITE_NAME} {SUBJECT}', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>Hi ,</p>\r\n\r\n<p>{MESSAGE} </p>\r\n\r\n<p>Thanks</p>', 'en'),
(18, 'طلب تقديم العمل', '<p>لديك طلب مجموع عمل للمشروع {TITLE}.</p>\r\n\r\n<p>اسم العقد: {CONTRACT_TITLE}</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {WORK_URL}</p>', 'ar'),
(18, 'Work submission request', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>You have a work sumission request for the project <strong>{TITLE} </strong>.</p>\r\n\r\n<p>Contract Name: <strong>{CONTRACT_TITLE}</strong></p>\r\n\r\n<p><br>\r\n<a href=\"{WORK_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {WORK_URL}</p>', 'en'),
(19, 'طلب فاتورة بالساعة', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {RECEIVER_NAME} ،<br>\r\nلديك طلب فاتورة عمل للمشروع {TITLE}.</p>\r\n\r\n<p>اسم العقد: {CONTRACT_TITLE}</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {WORK_URL}</p>', 'ar'),
(19, 'Hourly Invoice Request', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>You have a work invoice request for the project <strong>{TITLE} </strong>.</p>\r\n\r\n<p>Contract Name: <strong>{CONTRACT_TITLE}</strong></p>\r\n\r\n<p><br>\r\n<a href=\"{WORK_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {WORK_URL}</p>', 'en'),
(20, 'بدء معلم جديد', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {RECEIVER_NAME} ،<br>\r\nبدأ العميل إنجازًا جديدًا للمشروع {TITLE}.</p>\r\n\r\n<p>اسم العقد: {CONTRACT_TITLE}</p>\r\n\r\n<p>اسم الحدث الرئيسي: {MILESTONE_TITLE}</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {WORK_URL}</p>', 'ar'),
(20, 'New milestone Initiate', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>Client have  initiate new milestone for the project <strong>{TITLE} </strong>.</p>\r\n\r\n<p>Contract Name: <strong>{CONTRACT_TITLE}</strong></p>\r\n\r\n<p>Milestone Name: <strong>{MILESTONE_TITLE}</strong></p>\r\n\r\n<p><br>\r\n<a href=\"{WORK_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {WORK_URL}</p>', 'en'),
(21, 'تم قبول تقديمك.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {RECEIVER_NAME} ،<br>\r\nتم قبول طلب مجموع العمل الخاص بك للمشروع {TITLE}.</p>\r\n\r\n<p>اسم العقد: {CONTRACT_TITLE}</p>\r\n\r\n<p>اسم الحدث الرئيسي: {MILESTONE_TITLE}</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {WORK_URL}</p>', 'ar'),
(21, 'Your submission has been accepted.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>Your work sumission request for the project <strong>{TITLE}</strong> has been accepted .</p>\r\n\r\n<p>Contract Name: <strong>{CONTRACT_TITLE}</strong></p>\r\n\r\n<p>Milestone Name: <strong>{MILESTONE_TITLE}</strong></p>\r\n\r\n<p><br>\r\n<a href=\"{WORK_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {WORK_URL}</p>', 'en'),
(22, 'تم رفض تقديمك.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<p>مرحبًا {RECEIVER_NAME} ،<br>\r\nتم قبول طلب مجموع العمل الخاص بك للمشروع {TITLE}.</p>\r\n\r\n<p>اسم العقد: {CONTRACT_TITLE}</p>\r\n\r\n<p>اسم الحدث الرئيسي: {MILESTONE_TITLE}</p>\r\n\r\n<p>السبب: {REJECT_REASON}</p>\r\n\r\n<p><br>\r\nاضغط هنا لعرض التفاصيل</p>\r\n\r\n<p>إذا لم ينجح النقر فوق الزر أعلاه ، فانسخ عنوان url التالي والصقه في نافذة متصفح جديدة: {WORK_URL}</p>', 'ar'),
(22, 'Your submission has been rejected.', '<p>{WEBSITE_LOGO}</p>\r\n\r\n<h2>Hi {RECEIVER_NAME},</h2>\r\n\r\n<p>Your work sumission request for the project <strong>{TITLE}</strong> has been accepted .</p>\r\n\r\n<p>Contract Name: <strong>{CONTRACT_TITLE}</strong></p>\r\n\r\n<p>Milestone Name: <strong>{MILESTONE_TITLE}</strong></p>\r\n\r\n<p><b>Reason : </b>{REJECT_REASON}</p>\r\n\r\n<p><br>\r\n<a href=\"{WORK_URL}\">Click Here To view details </a></p>\r\n\r\n<hr>\r\n<p>If clicking the button above does not work, copy and paste the following url in a new browser window: {WORK_URL}</p>', 'en'),
