(9, 9, 'Hi,\r\nam building an online marketplace that connects employers and remote staff that work from home. Very similar to Upwork. The idea is by using blockchain we can create additional savings for employers and freelancers by reducing the costs of a centralized third party (lower transaction fees) while at the same time providing a safe and reliable piece of technology that can connect employers and freelancers around the world and allow people to pay and get paid with digital cryptocurrency in addition to traditional fit currencies.  \r\n\r\nI am looking to hire a cryptocurrency/blockchain expert to help me determine the right strategy to undertake for launching this idea concept.\r\n\r\nThe idea is by allowing employers and freelancers and remote workers to pay and get paid with digital currencies will open up new lines of finance for employers and help traditionally unbanked populations get paid for their talent and skills.\r\n\r\nIf this is something you are interested in helping me with please send your proposal.', 1),
(10, 10, 'We are looking for a web UX/UI designer who can take Illustrator file mockups for a website and turn theme into a Wordpress theme that is made in and for the Elementor plugin. This designer must have experience with the Elementor plugin for Wordpress. We are looking for a freelancer who can take direction, communicates often and effectively, and can follow a mockup, but will suggest small changes to the design if it will make the User Experience easier and better. This project does have a tight deadline, so please only apply if you have the ability to meet the deadline.\r\n\r\nWe will provide you with the mockups and all files that will be needed. Since this is a theme creation, everything needs to be editable for changes and updating when needed. This project is unique in we want to ensure we find the right fit. We want to hire someone for a \'test\' round. So this is a one time project with potential of turning into an extension of this if we mutually agree this went well. If you complete the \'test\' project on time, follow the mockups, and maintain clear communication through the process, we should align and be able to move forward. Please only apply if you feel you can complete this project and have the availability to work on the extended project.\r\n\r\nThis \'test\' project:\r\nThe designer is to create 2 pages of an Elementor theme for Wordpress from 2 AI file mockups provided. We are aiming to hire by Tuesday 2/23/21 and have these 2 pages completed by Sunday 2/28/21. These pages must be editable to allow internal maintenance in the future.\r\n\r\nAttached are pdf files of the 2 web page mockups. Once a freelancer is chosen, you will be given the AI files, pdf files of the mockups with notes, imagery to be used, and branding details. Please do not hesitate to ask any questions.\r\n\r\nPlease note: If we decide to shortlist you, we will be in contact shortly to ask a few more questions and align on the extended portion of this project if we move forward.\r\n\r\n\r\nWho we are:\r\nWe are a fast growing healthcare tech start-up. We are building a marketplace platform that will transform the way healthcare procurement processes are done, for the better. We are a global company with people working remotely from United Kingdom, India, the United States and more. This job is going to report to our Creative Marketing Director.', 1),
