(13, 13, 'The main goal of our project is to automatize book exchange process. The project must have User registration, posting ads (like in olx), ai-based recommendations system based on the interests of the user that they specify during registration, and a chat system. All of that will need to be done on rest API for further integration on android applications.\r\nThe main goal of our project is to automatize book exchange process. The project must have User registration, posting ads (like in olx), ai-based recommendations system based on the interests of the user that they specify during registration, and a chat system. All of that will need to be done on rest API for further integration on android applications.', 1),
