(18, 18, 'I am looking for a web designer with a skill set that is off the ‘road travelled’ by.\r\n\r\nWe want a bespoke design for a responsive WebApp that will stand out as one of a kind. A strong reference will be provided by way of a design template that appeals to us.\r\n\r\nThis is essentially a B2C marketplace website (web App really) that needs to be responsive and designed with the mobile interface in mind. The mobile app will be implemented at a later stage.  So a finger on the pulse of UI/ UX intuition will dictate the layout and good taste will be required to assure a friendly design and clear navigation.\r\n\r\nOne may use and design tools like Photoshop or Illustrator or Adobe XD but since the design will later go in for coding, the output needed has to be mandatory HTML or Figma files.\r\n\r\nAlthough Fiverr will be the agency where payment will be held as escrow, it is important that the designer be willing to work on screen share with us to enable quick turn around and accuracy of desired outcome.\r\n\r\nThe layout will be scaled up and the designer can be assured of continuing assignments. Please reply with links to just about 3 of your work samples that suit the above brief. Not more … :)', 1),
(19, 19, 'Do not contact me any other way apart from on Upwork.\r\n\r\nI am looking for a PHP wizz to help me create a custom social media website.\r\n\r\nI am going to purchase the sngine script. But I do not like the way it looks plus I need some extra features added and changes to the way some things work.\r\n\r\nThe script seems pretty good and clean and has lots of the functions that I want.\r\n\r\nI need someone to get this site to 100% complete. Everything working and looking good.\r\n1. It needs to have custom features added.\r\n2. It needs to have a full redesign done.\r\n3. Make sure the site is secure from hacks and spam. Also able to be updated.\r\n4. Make sure the site is fast and ready for lots of traffic.\r\n5. Make sure all emails and external functions are working as well.\r\n6. Setup the APP files for APP Store (part of PHP script just needs to line up with custom design)\r\n\r\nMilestones.\r\n1. Setup custom features that are not part of the purchased script.\r\n• I need another version on Pages example “pages2” which only I control, and a can add the content. Plus content needs to be added via CSV regularly.\r\n• This pages2 will need lots more fields\r\n• Plus it will need four subcategories which will all have their own pages with fields and walls and follow buttons.\r\n• When you post to a wall in a sub-category it gets posted on all walls on categories below.\r\n• Setup for different countries languages  https://au.domain https://uk.domain also a part of the Pages2 has prices for different countries so that needs to change when viewing from different country. For other parts of the site it would be good if it automatically changes to what ever country, they are in link articles and things.\r\n\r\n2. Redesign the layout and look of the theme.\r\n• The whole look of the theme needs to change, My design will use 1 standard look and layout for almost all pages.\r\n• Lots of the standard features I want turned off and hidden. Example “Poke” can be deleted. Marketplace, games, and lots of other things can be turned off/hidden as I might want them later. To start just want very limited features.\r\n• The user-generated post area I want simpler and redesigned.\r\n• Point system needs to be changed a little too.\r\n\r\n3. Speed and Future-proofed\r\n• Last part will be speed and setting up for the future hopefully this takes off with 12months and I can start expanding.\r\n• If not this needs to be maintenance-free.\r\n• Set up elastic search and cloud images which is part of my server anyway but just set up properly. Cloudflare and anything else to make this site as fast as possible.\r\n\r\n4. IOS and Android APP’s   \r\n• The site is set up to turn easily turn into an APP I have watched the video it takes like 20 mins to get the APX. So the custom changes need to work in line with these app setups.\r\n\r\nI hope this will turn into a long-term working relationship.\r\nLet\'s get it working perfectly so hopefully, it can grow and I can hire you on an ongoing basis.\r\n\r\nThanks\r\nMarcus', 1),
(20, 20, 'My client has a food delivery website, need to integrate WooCommerce with telegram bot\r\n\r\nWhen a order is placed from a restaurant by customer ,the order details need to be sent to the particular Restaurant owner and either he accepts the order or rejects it\r\n\r\nThe problem I\'m facing is how to find out from which restaurant is the order being placed and  send details to that  owner\r\n\r\nUrgently required\r\nSend the proposals if you have experience and the budget will be low ,just a simple task to be done', 1),
(21, 21, 'Hello I required a skilled PHP developer to help with my ecommerce website, mobile app APIs, and other projects.\r\n\r\nThe ecommerce site is my immediate priority; I use OpenCart as the foundation but have heavily customized the php code to support various features. Knowledge of OpenCart is not required as it uses standard MVCL architecture. I\'m an intermediate PHP developer myself but I also own my own business which is growing and I need help maintaining and building my code base.\r\n\r\nMuch of the work is focused around APIs such as calling shipping companies for estimates and shipments, and updating/creating my own APIs for mobile apps and other technologies. OpenCart is the immediate focus for me, but I have other projects. I try to keep to PHP and JavaScript wherever I can and have spent a lot of time creating and updating the OpenAPI documentation\r\n\r\nMy requirements:\r\n- at least 3 years php experience, particularly with MVC (model view controller language) architecture\r\n- solid understanding of MySQL, CURL, OAUTH required\r\n- good understanding of JavaScript\r\n- good understanding of creating and reading OpenAPI documentation (Swagger) version 3\r\n- basic understanding of Docker, SFTP, Apache, cloud servers (i host and manage my own servers in various providers)\r\n- opencart experience is a bonus', 1),
(22, 22, 'We are looking for a hardworking Customer Service Specialist. This is a full-time, entry-level position with great potential for advancement to the right employee(s). Please be aware, this position will be from Monday-Friday, 8:30am - 5:30pm US EST.', 1),
