(70, 70, 'علامة تجارية تكون باطار احترافيتتنوع الفرص الوظيفية المتاحة في هذا القطاع باختلاف طبيعة هذه العقود حيث تتطلب هذه العقود الكثير من التخصصات والمستويات الإدارية والفنية، كما أن نسبة التوطين الأدنى محددة لكل مستوى وفئة وظيفية.\r\n\r\nتتنوع الفرص الوظيفية المتاحة في هذا القطاع باختلاف طبيعة هذه العقود حيث تتطلب هذه العقود الكثير من التخصصات والمستويات الإدارية والفنية، كما أن نسبة التوطين الأدنى محددة لكل مستوى وفئة وظيفية.\r\nتتنوع الفرص الوظيفية المتاحة في هذا القطاع باختلاف طبيعة هذه العقود حيث تتطلب هذه العقود الكثير من التخصصات والمستويات الإدارية والفنية، كما أن نسبة التوطين الأدنى محددة لكل مستوى وفئة وظيفية.', 1),
