(77, 77, 'المَعرِفَة هي الإدراك والوعي وفهم الحقائق عن طريق العقل المجرد أو بطريقة اكتساب المعلومات بإجراء تجربة وتفسير نتائج التجربة أو تفسير خبر، أو من خلال التأمل في طبيعة الأشياء وتأمل النفس أو من خلال الإطلاع على تجارب الآخرين وقراءة استنتاجاتهم. إن المعرفة مرتبطة بالبديهة والبحث لاكتشاف المجهول وتطوير الذات وتطوير التقنيات.\r\n\r\nالمعرفة يحددها قاموس أوكسفورد الإنكليزي بأنها : (أ) الخبرات والمهارات المكتسبة من قبل شخص من خلال التجربة أو التعليم ؛ الفهم النظري أو العملي لموضوع، (ب) مجموع ما هو معروف في مجال معين ؛ الحقائق والمعلومات، الوعي أو الخبرة التي اكتسبتها من الواقع أو من القراءة أو المناقشة، (ج) المناقشات الفلسفية في بداية التاريخ مع أفلاطون صياغة المعرفة بأنها \"الإيمان الحقيقي المبرر\". بيد أنه لا يوجد تعريف متفق عليه واحد من المعارف في الوقت الحاضر، ولا أي احتمال واحد، وأنه لا تزال هناك العديد من النظريات المتنافسة. كما تعرف المعرفة أيضا بأنها:\r\n\r\nتنقسم إلى فروع، تسمى فروع المعرفة، في حالات يمكن تلقينها أو إستنتاجها وحفظها في كتاب أو مقالة أو ورقة، تشمل جميع هذه الفروع بطريقة محايدة (أغلب الأحيان).\r\nوصف لحالة أو عملية لبعض الجوانب الحياتية بالنسبة لأشخاص أو مجموعات مستعدة لها، فمثلا إذا كنت \"أعرف\" أنها ستمطر، فإنني سوف آخذ مظلتي معي عند الخروج.\r\nوالمعرفة أيضاً هي ثمرة التقابل والاتصال بين الذات المدركة وموضوع مدرك، وتتميز من باقي معطيات الشعور، من حيث أنها تقوم في آن واحد على التقابل والاتحاد الوثيق بين هذين الطرفين.\r\nوقد قدم لنا الأستاذ الدكتور عبد الوهاب المسيري تعريفاً اجرائياً لكلمة معرفة وهو أقرب إلى الأذهان لدارس الفلسفة بقوله \"المعرفي هو الكلي والنهائي وتعبير الكلية هنا يفيد الشمول والعموم في حين أن النهائية للوجود تعنى غائيته وآخره وأقصى مايمكن أن يبلغه الشئ ويمكن التوصل للبعد المعرفي لأي خطاب أو أي ظاهرة من خلال دراسة ثلاثة عناصر أساسية:\r\n\r\nالإله\r\nالطبيعة\r\nالإنسان\r\n\r\nمحتويات\r\n1 الفرق بين البيانات والمعلومات والمعرفة\r\n2 الفرق بين العلم والمعرفة\r\n3 أنواع المعارف\r\n4 نشأة نظرية المعرفة عند اليونان\r\n5 تأثير المعرفة على القوة\r\n5.1 المعرفة سبيل القوة\r\n6 أقوال\r\n7 أثر المعرفة في التطور السريع\r\n8 حرب إلكترونية\r\n9 اقرأ أيضا\r\n10 مصادر\r\nالفرق بين البيانات والمعلومات والمعرفة\r\nالبيانات هي مجموعة من العناصر أو القيم التي لا تعطي معنى واضحا لأنها غير معالجة أو مرتبة أو منظمة بطريقة تساعد على فهمها.\r\n\r\nالمعلومات هي البيانات المعالجة والواضحة التي تؤدي إلى زيادة الحصيلة المعلوماتية للشخص إما عن طريق إضافة حقائق جديدة، أو التأكيد والتعديل على حقائق سابقة.\r\n\r\nأما المعرفة فتمثل مجموعة من القرارات أو الأعمال التي تعتمد على المعلومات، فالمعرفة مرتبطة بالسلوك الإنساني وتعامله مع المعلومات. وبالتالي فإن الشخص الذي لديهِ قدر من المعرفة هو من يعرف كيف يستخدم المعلومات المتوفرة لديه.', 1),
(78, 78, 'المَعرِفَة هي الإدراك والوعي وفهم الحقائق عن طريق العقل المجرد أو بطريقة اكتساب المعلومات بإجراء تجربة وتفسير نتائج التجربة أو تفسير خبر، أو من خلال التأمل في طبيعة الأشياء وتأمل النفس أو من خلال الإطلاع على تجارب الآخرين وقراءة استنتاجاتهم. إن المعرفة مرتبطة بالبديهة والبحث لاكتشاف المجهول وتطوير الذات وتطوير التقنيات.\r\n\r\nالمعرفة يحددها قاموس أوكسفورد الإنكليزي بأنها : (أ) الخبرات والمهارات المكتسبة من قبل شخص من خلال التجربة أو التعليم ؛ الفهم النظري أو العملي لموضوع، (ب) مجموع ما هو معروف في مجال معين ؛ الحقائق والمعلومات، الوعي أو الخبرة التي اكتسبتها من الواقع أو من القراءة أو المناقشة، (ج) المناقشات الفلسفية في بداية التاريخ مع أفلاطون صياغة المعرفة بأنها \"الإيمان الحقيقي المبرر\". بيد أنه لا يوجد تعريف متفق عليه واحد من المعارف في الوقت الحاضر، ولا أي احتمال واحد، وأنه لا تزال هناك العديد من النظريات المتنافسة. كما تعرف المعرفة أيضا بأنها:\r\n\r\nتنقسم إلى فروع، تسمى فروع المعرفة، في حالات يمكن تلقينها أو إستنتاجها وحفظها في كتاب أو مقالة أو ورقة، تشمل جميع هذه الفروع بطريقة محايدة (أغلب الأحيان).\r\nوصف لحالة أو عملية لبعض الجوانب الحياتية بالنسبة لأشخاص أو مجموعات مستعدة لها، فمثلا إذا كنت \"أعرف\" أنها ستمطر، فإنني سوف آخذ مظلتي معي عند الخروج.\r\nوالمعرفة أيضاً هي ثمرة التقابل والاتصال بين الذات المدركة وموضوع مدرك، وتتميز من باقي معطيات الشعور، من حيث أنها تقوم في آن واحد على التقابل والاتحاد الوثيق بين هذين الطرفين.\r\nوقد قدم لنا الأستاذ الدكتور عبد الوهاب المسيري تعريفاً اجرائياً لكلمة معرفة وهو أقرب إلى الأذهان لدارس الفلسفة بقوله \"المعرفي هو الكلي والنهائي وتعبير الكلية هنا يفيد الشمول والعموم في حين أن النهائية للوجود تعنى غائيته وآخره وأقصى مايمكن أن يبلغه الشئ ويمكن التوصل للبعد المعرفي لأي خطاب أو أي ظاهرة من خلال دراسة ثلاثة عناصر أساسية:\r\n\r\nالإله\r\nالطبيعة\r\nالإنسان\r\n\r\nمحتويات\r\n1 الفرق بين البيانات والمعلومات والمعرفة\r\n2 الفرق بين العلم والمعرفة\r\n3 أنواع المعارف\r\n4 نشأة نظرية المعرفة عند اليونان\r\n5 تأثير المعرفة على القوة\r\n5.1 المعرفة سبيل القوة\r\n6 أقوال\r\n7 أثر المعرفة في التطور السريع\r\n8 حرب إلكترون