(26, 1, NULL, 39, 15.00, 10.00, 0, NULL, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur fermentum et mi vitae posuere. Pellentesque in magna vitae nisi semper ullamcorper sed non orci. Praesent luctus ultrices ligula eu ullamcorper. Etiam hendrerit, dolor quis pharetra pulvinar, odio purus interdum elit, quis gravida velit eros ut ex. Vivamus vel consequat purus. Nam aliquam nec quam eu luctus. Phasellus sit amet est felis. Sed at aliquam felis, id elementum arcu. Curabitur eget sagittis nisl. Nullam egestas eleifend velit. Suspendisse eu malesuada urna. Vivamus feugiat justo et velit porta tincidunt.', NULL, '2022-02-12 07:34:24', NULL, 0, NULL, 1),
