INSERT INTO `pref_testimonial_names` (`testimonial_id`, `name`, `company_name`, `description`, `lang`) VALUES
(2, 'Michelle Mitchell', 'Director', 'I am amazed by its potential. Upwork clone script is perfect for recruiters looking for the best freelancers to work with. The code is highly utilitarian for creating a business niche. You can certainly give it a try.', 'en'),
(2, 'ميشيل ميتشل', 'مخرج', 'أنا مندهش من إمكاناتها. يعد برنامج استنساخ Upwork مثاليًا لموظفي التوظيف الذين يبحثون عن أفضل العاملين لحسابهم الخاص للعمل معهم. الكود مفيد للغاية لإنشاء مكانة تجارية. يمكنك بالتأكيد أن تجربها.', 'ar'),
(4, 'Klaus Gruber', 'Marketing Head', 'Thank you for this amazing Upwork clone script. It’s been an amazing journey ever since I gave it a chance. Highly recommended!', 'en'),
(4, 'كلاوس جروبر', 'رئيس التسويق', 'شكرا لك على هذا السيناريو المذهل لاستنساخ Upwork. لقد كانت رحلة رائعة منذ أن أعطيتها الفرصة. ينصح به بشده!', 'ar'),
(1, 'Amanda Cook', 'XYZ Company', 'If you looking for a powerful Upwork clone script to start your gig platform, this is the best option for you. It surpassed my expectations. Don’t think, just go for it.If', 'en'),
(1, 'أماندا كوك', 'شركة XYZ', 'إذا كنت تبحث عن برنامج نصي قوي لاستنساخ Upwork لبدء منصة الحفلة ، فهذا هو \r\nإذا كنت تبحث عن برنامج نصي قوي لاستنساخ Upwork لبدء منصة الحفلة ، فهذا هو الخيار الأفضل لك. لقد فاق توقعاتي. لا تفكر ، فقط افعلها.إذا كنت تبحث', 'ar'),
(3, 'Ryan Garcia', 'Social Activist', 'I wish I found this Upwork clone script earlier! I was frantically searching for a capable Upwork clone and then, I came across this. It has top-quality job listings, SEO optimized and user-friendly. Totally worth it!', 'en'),
(3, 'ريان جارسيا', 'ناشط اجتماعي', 'أتمنى لو وجدت هذا البرنامج النصي استنساخ Upwork في وقت سابق! كنت أبحث بشكل محموم عن استنساخ قادر على Upwork وبعد ذلك ، صادفت هذا. يحتوي على قوائم وظائف عالية الجودة ومحسّنة لكبار المسئولين الاقتصاديين وسهلة الاستخدام. يستحقها تماما!', 'ar');
